import React, { Component } from "react";
import {
  Button,
  View,
  Text,
  TouchableOpacity,
  ListView,
  StyleSheet,
  FlatList,
  Section,
  TouchableHighlight,
  TextInput,
  ScrollView,
} from "react-native";
import {
  Table,
  TableWrapper,
  Row,
  Rows,
  Col,
  Cols,
  Cell,
} from "react-native-table-component";
import Modal from "react-native-modal";

import courseList from "./data/courses.json";
import FitnessInfoFunction from "./FitnessInfoFunction";

class Fitnessinfo extends Component {
  constructor(props) {
    super(props);

    this.state = {
      tableHead: ["Name", "Preis", "Beschreibung"],
      courseList: [],
      isModalVisible: false,
    };
  }

  componentDidMount() {
    this.setState({ courseList: courseList });
  }
  toggleModal = () => {
    this.setState({ isModalVisible: !this.state.isModalVisible });
  };

  _addCourse() {
    console.log("Added");
  }
  _deleteCourse(id) {
    const { courseList } = this.state;
    this.setState({
      courseList: courseList.filter((fitness) => fitness.id !== id),
    });
    console.log("Deleted");
    return;
  }

  render() {
    const element = (data, index) => (
      <TouchableHighlight onPress={() => this._deleteCourse}>
        <View>
          <Text>button</Text>
        </View>
      </TouchableHighlight>
    );
    const courseList = this.state.courseList.map((fitness) => [
      fitness.name,
      fitness.price,
      fitness.description,
    ]);
    return (
      <View style={styles.contentContainer}>
        <Button title="Add" onPress={this.props.FitnessInfoFunction}></Button>
        <View style={styles.header}>
          <Text style={styles.headerText}> List Header </Text>
        </View>
        <FlatList
          data={courseList}
          keyExtractor={(item) => item.name}
          renderItem={this.renderItem}
        />
      </View>
    );
  }
}

const styles = StyleSheet.create({
  header: {
    height: 60,
    backgroundColor: "orange",
    alignItems: "center",
    justifyContent: "center",
  },
  headerText: {
    fontSize: 20,
    fontWeight: "bold",
    color: "white",
  },
  contentContainer: {
    backgroundColor: "white",
  },
  item: {
    flexDirection: "row",
    borderBottomWidth: 1,
    borderBottomColor: "grey",
    alignItems: "center",
  },
  marginLeft: {
    marginLeft: 5,
  },
  menu: {
    width: 20,
    height: 2,
    backgroundColor: "#111",
    margin: 2,
    borderRadius: 3,
  },
  text: {
    marginVertical: 30,
    fontSize: 20,
    fontWeight: "bold",
    marginLeft: 10,
  },

  textInput: {
    width: "90%",
    marginLeft: 10,
    marginRight: 10,
    marginBottom: 30,
    borderColor: "gray",
    borderBottomWidth: 2,
    fontSize: 16,
  },
  modalView: {
    flex: 1,
    backgroundColor: "white",
    alignItems: "center",
    justifyContent: "center",
  },
  touchableHighlight: {
    backgroundColor: "white",
    marginVertical: 10,
    alignSelf: "stretch",
    alignItems: "center",
  },
});

export default Fitnessinfo;

